import React from 'react';
import './Introduction.css';

import headshot from "../../assets/Headshots/ranch_kevin.jpg"; ;

const Introduction = () => {
  return (
    <section id='Introduction'>

        <img id="ranch_kevin_photo" src={ headshot} alt="Kevin at the ranch"></img>
        <h1 class="title">Kevin Yejoon Lee.</h1>
        <h1 class="paragraph">Hi! I'm an aspiring Software Engineer. I feel alive when I'm 
        creating, designing & writing, seeing the end result is always worth it. I hope we can work together!</h1>



    </section>
  )
}

export default Introduction;
